using NUnit.Framework;
using Moq;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.Logging;
using System.Threading.Tasks;
using System.Collections.Generic;
using System;
using Emgu.CV;
using Emgu.CV.Structure;
using WebApplication3.Controllers;
using AttendanceApi.Repository;
using AttendanceApi.Models.Domain;
using AutoMapper;
using WebApplication3.Models.DTO;
using AttendanceApi.Models.DTO.Request;

namespace Tests.Controllers
{
    [TestFixture]
    public class FaceControllerTests
    {
        private Mock<ILogger<FaceController>> _loggerMock;
        private Mock<IMapper> _mapperMock;
        private Mock<IAttendanceRepository> _attendanceRepositoryMock;
        private Mock<ICourseModuleRepository> _moduleRepositoryMock;
        private Mock<IStudentRepository> _studentRepositoryMock;
        private Mock<ICourseRepository> _courseRepositoryMock;
        private FaceController _controller;

        [SetUp]
        public void Setup()
        {
            _loggerMock = new Mock<ILogger<FaceController>>();
            _mapperMock = new Mock<IMapper>();
            _attendanceRepositoryMock = new Mock<IAttendanceRepository>();
            _moduleRepositoryMock = new Mock<ICourseModuleRepository>();
            _studentRepositoryMock = new Mock<IStudentRepository>();
            _courseRepositoryMock = new Mock<ICourseRepository>();
            _controller = new FaceController(
                _loggerMock.Object,
                _attendanceRepositoryMock.Object,
                _mapperMock.Object,
                _moduleRepositoryMock.Object,
                _studentRepositoryMock.Object,
                _courseRepositoryMock.Object);
        }

        [Test]
        public async Task AutoTrainModel_ShouldReturnOkResultWithLog()
        {
            // Arrange
            _courseRepositoryMock.Setup(repo => repo.GetAllAsync()).ReturnsAsync(new List<Course> { new Course { Id = 1, Name = "Course1" } });
            _studentRepositoryMock.Setup(repo => repo.CreateAsync(It.IsAny<Student>())).ReturnsAsync(new Student { Id = 1 });

            // Act
            var result = await _controller.AutoTrainModel();

            // Assert
            var okResult = result as OkObjectResult;
            Assert.IsNotNull(okResult);
            Assert.AreEqual(200, okResult.StatusCode);
            Assert.IsTrue(okResult.Value.ToString().Contains("images trained in"));
        }

        [Test]
        public async Task Recognize_ShouldReturnSuccess_WhenFaceIsRecognized()
        {
            // Arrange
            var student = new Student { Id = 1, FirstName = "John", LastName = "Doe", CourseId = 1 };
            var schedule = new List<Schedule>
            {
                new Schedule { CourseModuleId = 1, From = DateTime.Now.AddMinutes(-10), To = DateTime.Now.AddMinutes(50) }
            };

            _studentRepositoryMock.Setup(repo => repo.GetAsync(It.IsAny<int>())).ReturnsAsync(student);
            _moduleRepositoryMock.Setup(repo => repo.GetSheduleAsync(It.IsAny<int>())).ReturnsAsync(schedule);
            _attendanceRepositoryMock.Setup(repo => repo.CreateAsync(It.IsAny<Attendance>())).ReturnsAsync(new Attendance());
            // string base64Image = "";

            // string base64Image = "";
            string base64Image = "";
            
            // Act
            var result = await _controller.Recognize(base64Image);

            // Assert
            var okResult = result as OkObjectResult;
            Assert.IsNotNull(okResult);
            Assert.AreEqual(200, okResult.StatusCode);
        }

        [Test]
        public void Train_ShouldReturnOkResult_WhenTrainingIsSuccessful()
        {
            string base64Image = "";

            // Arrange
            var trainModelRequest = new TrainModelRequest
            {
                Base64Image = new List<string> { base64Image },
                StudentId = "199"
            };

            // Act
            var result = _controller.Train(trainModelRequest);

            // Assert
            var okResult = result as OkObjectResult;
            Assert.IsNotNull(okResult);
            Assert.AreEqual(200, okResult.StatusCode);
            Assert.AreEqual("success", okResult.Value);
        }

    }
}
